import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import TicketCard from '../components/TicketCard';
import ticketService from '../services/ticketService';
import userService from '../services/userService';
import '../styles/Dashboard.css';

const TechnicianDashboard = () => {
  const [dashboardData, setDashboardData] = useState({});
  const [assignedTickets, setAssignedTickets] = useState([]);
  const [unassignedTickets, setUnassignedTickets] = useState([]);
  const [recentlyResolved, setRecentlyResolved] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeSection, setActiveSection] = useState('assigned');

  useEffect(() => {
    fetchDashboardData();
    // Refresh every 2 minutes for real-time updates
    const interval = setInterval(fetchDashboardData, 120000);
    return () => clearInterval(interval);
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [
        statsResponse,
        assignedResponse,
        unassignedResponse,
        resolvedResponse
      ] = await Promise.all([
        userService.getTechnicianStats(),
        ticketService.getTickets({ 
          assignedTo: 'me', 
          status: ['open', 'in-progress'],
          limit: 6 
        }),
        ticketService.getTickets({ 
          assignedTo: '', 
          status: 'open',
          limit: 6 
        }),
        ticketService.getTickets({ 
          status: ['resolved', 'closed'],
          limit: 4,
          sortBy: 'updatedAt',
          sortOrder: 'desc'
        })
      ]);

      setDashboardData(statsResponse);
      setAssignedTickets(assignedResponse.tickets);
      setUnassignedTickets(unassignedResponse.tickets);
      setRecentlyResolved(resolvedResponse.tickets);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const quickActions = [
    {
      label: 'View Queue',
      description: 'See all unassigned tickets',
      icon: 'ðŸ“‹',
      action: () => setActiveSection('unassigned')
    },
    {
      label: 'My Tickets',
      description: 'View assigned to me',
      icon: 'ðŸ‘¤', 
      action: () => setActiveSection('assigned')
    },
    {
      label: 'Quick Resolve',
      description: 'Common solutions',
      icon: 'âš¡',
      path: '/knowledge-base'
    },
    {
      label: 'Performance',
      description: 'View my stats',
      icon: 'ðŸ“Š',
      path: '/technician/performance'
    }
  ];

  const performanceMetrics = [
    { label: 'Today Resolved', value: dashboardData.todayResolved || 0 },
    { label: 'Avg. Time', value: `${dashboardData.avgResolutionTime || 0}m` },
    { label: 'SLA Met', value: `${dashboardData.slaMet || 0}%` },
    { label: 'Satisfaction', value: `${dashboardData.satisfactionRate || 0}%` }
  ];

  if (loading) {
    return (
      <>
        <Navbar />
        <div className="loading">Loading technician dashboard...</div>
      </>
    );
  }

  return (
    <>
      <Navbar />
      <div className="dashboard technician-dashboard">
        {/* Header */}
        <div className="dashboard-header">
          <div className="header-main">
            <h1>Technician Dashboard</h1>
            <p>Manage tickets and track your performance</p>
          </div>
          <div className="header-actions">
            <Link to="/tickets" className="btn-primary">
              View All Tickets
            </Link>
          </div>
        </div>

        {/* Performance Stats */}
        <div className="stats-grid">
          <div className="stat-card highlight">
            <h3>Assigned to Me</h3>
            <div className="stat-number">{dashboardData.assignedTickets || 0}</div>
            <div className="stat-trend">
              {assignedTickets.length} need attention
            </div>
          </div>
          <div className="stat-card">
            <h3>Unassigned</h3>
            <div className="stat-number">{dashboardData.unassignedTickets || 0}</div>
            <div className="stat-trend">
              Waiting for assignment
            </div>
          </div>
          <div className="stat-card">
            <h3>Resolved Today</h3>
            <div className="stat-number">{dashboardData.todayResolved || 0}</div>
            <div className="stat-trend">
              Your completions
            </div>
          </div>
          <div className="stat-card">
            <h3>Avg. Time</h3>
            <div className="stat-number">{dashboardData.avgResolutionTime || 0}m</div>
            <div className="stat-trend">
              Resolution speed
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="quick-actions-section">
          <h2>Quick Actions</h2>
          <div className="quick-actions-grid">
            {quickActions.map((action, index) => (
              action.path ? (
                <Link 
                  key={index}
                  to={action.path} 
                  className="quick-action-card"
                >
                  <div className="action-icon">{action.icon}</div>
                  <div className="action-content">
                    <span className="action-label">{action.label}</span>
                    <span className="action-description">{action.description}</span>
                  </div>
                </Link>
              ) : (
                <button 
                  key={index}
                  onClick={action.action}
                  className="quick-action-card"
                >
                  <div className="action-icon">{action.icon}</div>
                  <div className="action-content">
                    <span className="action-label">{action.label}</span>
                    <span className="action-description">{action.description}</span>
                  </div>
                </button>
              )
            ))}
          </div>
        </div>

        {/* Ticket Sections with Tabs */}
        <div className="ticket-sections">
          <div className="section-tabs">
            <button 
              className={`tab-button ${activeSection === 'assigned' ? 'active' : ''}`}
              onClick={() => setActiveSection('assigned')}
            >
              My Tickets ({assignedTickets.length})
            </button>
            <button 
              className={`tab-button ${activeSection === 'unassigned' ? 'active' : ''}`}
              onClick={() => setActiveSection('unassigned')}
            >
              Unassigned ({unassignedTickets.length})
            </button>
            <button 
              className={`tab-button ${activeSection === 'resolved' ? 'active' : ''}`}
              onClick={() => setActiveSection('resolved')}
            >
              Recently Resolved ({recentlyResolved.length})
            </button>
          </div>

          <div className="tab-content">
            {/* Assigned Tickets */}
            {activeSection === 'assigned' && (
              <div className="ticket-section">
                <div className="section-header">
                  <h3>Tickets Assigned to You</h3>
                  <span className="section-subtitle">
                    {assignedTickets.length} tickets requiring your attention
                  </span>
                </div>
                {assignedTickets.length === 0 ? (
                  <div className="empty-state">
                    <div className="empty-icon">âœ…</div>
                    <h4>No Assigned Tickets</h4>
                    <p>All clear! Check unassigned tickets to help colleagues.</p>
                    <button 
                      onClick={() => setActiveSection('unassigned')}
                      className="btn-primary"
                    >
                      View Unassigned Tickets
                    </button>
                  </div>
                ) : (
                  <div className="tickets-grid">
                    {assignedTickets.map(ticket => (
                      <TicketCard key={ticket._id} ticket={ticket} />
                    ))}
                  </div>
                )}
              </div>
            )}

            {/* Unassigned Tickets */}
            {activeSection === 'unassigned' && (
              <div className="ticket-section">
                <div className="section-header">
                  <h3>Unassigned Tickets</h3>
                  <span className="section-subtitle">
                    {unassignedTickets.length} tickets waiting for assignment
                  </span>
                </div>
                {unassignedTickets.length === 0 ? (
                  <div className="empty-state">
                    <div className="empty-icon">ðŸŽ‰</div>
                    <h4>No Unassigned Tickets</h4>
                    <p>Great job team! All tickets are currently assigned.</p>
                  </div>
                ) : (
                  <div className="tickets-grid">
                    {unassignedTickets.map(ticket => (
                      <TicketCard 
                        key={ticket._id} 
                        ticket={ticket} 
                        showAssignButton={true}
                      />
                    ))}
                  </div>
                )}
              </div>
            )}

            {/* Recently Resolved */}
            {activeSection === 'resolved' && (
              <div className="ticket-section">
                <div className="section-header">
                  <h3>Recently Resolved</h3>
                  <span className="section-subtitle">
                    Your recently completed tickets
                  </span>
                </div>
                {recentlyResolved.length === 0 ? (
                  <div className="empty-state">
                    <div className="empty-icon">ðŸ“Š</div>
                    <h4>No Recent Resolutions</h4>
                    <p>Completed tickets will appear here.</p>
                  </div>
                ) : (
                  <div className="tickets-grid">
                    {recentlyResolved.map(ticket => (
                      <TicketCard key={ticket._id} ticket={ticket} />
                    ))}
                  </div>
                )}
              </div>
            )}
          </div>
        </div>

        {/* Urgent Tickets Alert */}
        {(assignedTickets.some(t => t.urgency === 'critical') || 
         unassignedTickets.some(t => t.urgency === 'critical')) && (
          <div className="urgent-alert">
            <div className="alert-content">
              <span className="alert-icon">ðŸš¨</span>
              <div className="alert-text">
                <strong>Critical Tickets Need Attention</strong>
                <span>There are high-priority tickets requiring immediate action</span>
              </div>
            </div>
            <button 
              onClick={() => setActiveSection('assigned')}
              className="btn-primary"
            >
              View Critical Tickets
            </button>
          </div>
        )}

        {/* Performance Summary */}
        <div className="performance-summary">
          <h3>Your Performance Summary</h3>
          <div className="performance-grid">
            {performanceMetrics.map((metric, index) => (
              <div key={index} className="performance-metric">
                <span className="metric-value">{metric.value}</span>
                <span className="metric-label">{metric.label}</span>
              </div>
            ))}
          </div>
        </div>
      </div>
    </>
  );
};

export default TechnicianDashboard;
